sys_variable_value.value:
(function execute(inputs, outputs) {
	var CI = new GlideRecord('x_976337_license_c_u_cmdb_ci_licenses');
    CI.addQuery('sys_id', inputs['CI']);
  	CI.query();
  	if(CI.next()){
      var isActive = CI.active;
    }
  	var catalogItem = new GlideRecord('sc_cat_item');
  	catalogItem.addQuery('sys_id', inputs['catalog_item']);
  	catalogItem.query();
  	if(catalogItem.next()){
      catalogItem.active = isActive;
      catalogItem.update();
    }
})(inputs, outputs);

